import React, { useState, useEffect } from 'react';
import { Button, Dialog, DialogTitle, DialogContent, DialogActions, Grid } from '@mui/material';
import Select from '@mui/material/Select';
import MenuItem from '@mui/material/MenuItem';
import InputLabel from '@mui/material/InputLabel';
import FormControl from '@mui/material/FormControl';
import axios from 'axios';
import MainCard from 'ui-component/cards/MainCard';
import { gridSpacing } from 'store/constant';

const SpecialProjectEvaluation = () => {
  const [projectInfo, setProjectInfo] = useState({
    projectName: '',
    studentName: '',
    advisorName: '',
  });
  
  const [evaluation, setEvaluation] = useState({
    score: '',
    comments: '',
  });
  
  const [projects, setProjects] = useState([]); // State สำหรับเก็บข้อมูลโครงงานที่ดึงมาจาก API
  const [selectedProject, setSelectedProject] = useState(''); // State สำหรับเก็บโครงงานที่ถูกเลือก

  useEffect(() => {
    // ใช้ useEffect เพื่อเรียกข้อมูลโครงงานจาก API เมื่อคอมโพเนนต์ถูกโหลด
    axios.get('http://localhost:9999/Project')
      .then((response) => {
        setProjects(response.data); // ตั้งค่าโครงงานใน state
      })
      .catch((error) => {
        console.error('Error fetching projects:', error);
      });
  }, []);

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setEvaluation({ ...evaluation, [name]: value });
  };

  const handleProjectChange = (e) => {
    const selectedProject = e.target.value;
    setSelectedProject(selectedProject);

    // ค้นหาโครงงานที่ถูกเลือกจาก state projects
    const project = projects.find(proj => proj.P_id === selectedProject);
    if (project) {
      setProjectInfo({
        projectName: project.P_name,
        studentName: project.P_S1,
        advisorName: project.P_T,
      });
    }
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log('Submitting Evaluation:', evaluation);
    alert('การประเมินถูกส่งเรียบร้อยแล้ว');
  };

  const handleDonNotGoAny = () => {
    // Logic สำหรับ "ไม่เข้าร่วมประเมินทั้งหมด"
    alert('การดำเนินการไม่เข้าร่วมประเมินทั้งหมด');
  };

  return (
    <MainCard>
      <Grid container spacing={gridSpacing}>
        <Grid item xs={12}>
          <Grid container alignItems="center" justifyContent="space-between">
            <Grid item>
              <div>
                <h1>ประเมินการสอบหัวข้อโครงงานพิเศษ</h1>
                <Button onClick={handleDonNotGoAny} variant="contained" color="error">
                  ไม่เข้าร่วมประเมินทั้งหมด
                </Button>

                <h2>ชื่อโครงงาน </h2>
                <FormControl fullWidth>
                  <InputLabel id="ProjectName-select-label">เลือกชื่อโครงงาน</InputLabel>
                  <Select
                    labelId="ProjectName-select-label"
                    value={selectedProject}
                    onChange={handleProjectChange}
                    label="เลือกชื่อโครงงาน"
                  >
                    {projects.map((project) => (
                      <MenuItem key={project.P_id} value={project.P_id}>
                        {project.P_name}
                      </MenuItem>
                    ))}
                  </Select>
                </FormControl>
                
                {selectedProject && (
                  <div>
                    <h3>รายละเอียดโครงงาน</h3>
                    <p><strong>ชื่อโครงงาน:</strong> {projectInfo.projectName}</p>
                    <p><strong>ชื่อนักศึกษา:</strong> {projectInfo.studentName}</p>
                    <p><strong>อาจารย์ที่ปรึกษา:</strong> {projectInfo.advisorName}</p>
                  </div>
                )}

                <form onSubmit={handleSubmit}>
                  <div>
                    <TextField
                      name="score"
                      label="คะแนน"
                      type="number"
                      value={evaluation.score}
                      onChange={handleInputChange}
                      required
                      fullWidth
                    />
                  </div>
                  <div>
                    <TextField
                      name="comments"
                      label="ความคิดเห็น"
                      multiline
                      rows={4}
                      value={evaluation.comments}
                      onChange={handleInputChange}
                      required
                      fullWidth
                    />
                  </div>
                  <Button type="submit" variant="contained" color="primary">
                    ยืนยันการส่ง
                  </Button>
                </form>
              </div>
            </Grid>
          </Grid>
        </Grid>
      </Grid>
    </MainCard>
  );
};

export default SpecialProjectEvaluation;
